export default {
  mounted() {
    const paths = document.getElementsByClassName("land");
    const _this = this;
    Array.from(paths).forEach((path) => {
      path.addEventListener("mouseenter", (e) => {
        _this.$emit("hoverCountry", {
          code: e.target.id,
          name: e.target.attributes.title.value,
          position: {
            left: e.offsetX,
            top: e.offsetY,
